  [],\n\t\"title\": \"Unpublished Digital Glacial and Surficial Geologic Map of Summit
  County and parts of Cuyahoga County, Ohio (NPS, GRD, GRI, CUVA, SUCU digital map)
  adapted from Ohio Division of Geological Survey maps by Ford (1987), and White (1984)\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 225,\n\t\t\"recent\": 5\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2013-03-15T09:28:08.151279\",\n\t\"name\": \"unpublished-digital-glacial-and-surficial-geologic-map-of-summit-county-and-parts-of-cuyah-1984\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The Unpublished Digital Glacial and Surficial
  Geologic Map of Summit County and parts of Cuyahoga County, Ohio is composed of
  GIS data layers complete with ArcMap 9.3 layer (.LYR) files, two ancillary GIS tables,
  a Map PDF document with ancillary map text, figures and tables, a FGDC metadata
  record and a 9.3 ArcMap (.MXD) Document that displays the digital map in 9.3 ArcGIS.
  Presently, a GRI Google Earth KMZ/KML product doesn't exist for this map. The data
  were completed as a component of the Geologic Resources Inventory (GRI) program,
  a National Park Service (NPS) Inventory and Monitoring (I&M) Division funded program
  that is administered by the NPS Geologic Resources Division (GRD). Source geologic
  maps and data used to complete this GRI digital dataset were provided by the following:
  Ohio Division of Geological Survey. Detailed information concerning the sources
  used and their contribution the GRI product are listed in the Source Citation section(s)
  of this metadata record (sucu_metadata.txt; available at http://nrdata.nps.gov/geology/gri_data/gis/cuva/sucu_metadata.xml).
  Users of this data are cautioned about the locational accuracy of features within
  this dataset. Based on the source map scale of 1:62,500 and United States National
  Map Accuracy Standards features are within (horizontally) 31.8 meters or 104 feet
  of their actual location as presented by this dataset. Users of this data should
  thus not assume the location of features is exactly where they are portrayed in
  ArcGIS or other software used to display this dataset. All GIS and ancillary tables
  were produced as per the NPS GRI Geology-GIS Geodatabase Data Model v. 2.1. (available
  at: http://science.nature.nps.gov/im/inventory/geology/GeologyGISDataModel.cfm).
  The GIS data is available as a 9.3 personal geodatabase (sucu_geology.mdb), and
  as shapefile (.SHP) and DBASEIV (.DBF) table files. The GIS data projection is NAD83,
  UTM Zone 17N. The data is within the area of interest of Cuyahoga National Park.\",\n\t\"license_title\":
